import React from 'react';

class ProductsPage extends React.Component {
    render() {
        return (
            <Navbar />
        )
    }
}

class Navbar extends React.Component {
    render () {
        return (
            <div>
                <header>
                    <nav class="container justify-content-end navbar navbar-expand-lg navbar-light bg-light">
                        <a class="navbar-brand" href="./index.html"><i class="flaticon-gym"></i></a>
                        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText"
                            aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                            <span class="navbar-toggler-icon"></span>
                        </button>
                        <div class="collapse navbar-collapse" id="navbarText">
                            <ul class="navbar-nav ml-auto">
                                <li class="nav-item hover">
                                    <a class="nav-link" href="./index.html">Home <span class="sr-only">(current)</span></a>
                                </li>
                                <li class="nav-item active hover">
                                    <a class="nav-link" href="./product.html">Product</a>
                                </li>
                                <li class="nav-item hover">
                                    <a class="nav-link" href="./contact.html">Contact</a>
                                </li>
                            </ul>
                        </div>
                        </nav>
                    </header>
            </div>
        )
    }
}

class ProductHero extends React.Component {
    render () {
        return (
            <section class="container-fluid hero">
                <div class="hero-product">
                    <h1>Our <span class="yellow-text">Stock</span></h1>     
                 </div>
            </section>
        )
    }
}
export default ProductsPage;
